		/// <summary>
		/// Lookup Dictionary entry from tag
		/// </summary>
		/// <param name="tag">DICOM tag</param>
		/// <returns>Dictionary entry</returns>
		public static DcmDictionaryEntry Lookup(DicomTag tag) {
			lock (Lock) {
				if (!Initialzied)
					LoadInternalDictionary();
				DcmDictionaryEntry dde;
				if (!tag.IsPrivate && QuickLookup.TryGetValue(tag.Card, out dde)) {
					return dde;
				}
				foreach (DcmDictionaryEntry entry in Entries) {
					if (entry.IsMatchForTag(tag))
						return entry;
				}
				if ((tag.Group & 1) == 1)
					return PrivateTag;
				return UnknownTag;
			}
		}

		private const char Seperator = '\t';
		private const string Retired = "RETIRED";

		/// <summary>
		/// Internal use
		/// </summary>
		/// <param name="filename"></param>
		/// <param name="publicOnly"></param>
		/// <param name="privateOnly"></param>
		public static void ExportDictionary(string filename, bool includePublic, bool includePrivate) {
			StringBuilder sb = new StringBuilder();

			lock (Lock) {
				foreach (DcmDictionaryEntry entry in Entries) {
					if (entry.IsPrivate && !includePrivate)
						continue;
					if (!entry.IsPrivate && !includePublic)
						continue;
					string[] tag = entry.DisplayTag.ToLower().Split(',');
					sb.Append(tag[0]);
					sb.Append(Seperator);
					sb.Append(tag[1]);
					sb.Append(Seperator);
					for (int i = 0; i < entry.AllowedVRs.Length - 1; i++)
						sb.Append(entry.AllowedVRs[i].VR).Append('/');
					sb.Append(entry.AllowedVRs[entry.AllowedVRs.Length - 1].VR);
					sb.Append(Seperator);
					sb.Append(entry.VM);
					sb.Append(Seperator);
					sb.Append(entry.Name);
					sb.Append(Seperator);
					sb.Append(Retired);
					sb.Append(Seperator);
					sb.Append(entry.PrivateCreator);
					sb.AppendLine();
				}
			}

			File.WriteAllText(filename, sb.ToString());
		}

		/// <summary>
		/// Internal use
		/// </summary>
		/// <param name="filename"></param>
		public static void ImportDictionary(string filename) {
			lock (Lock) {
				string[] lines = File.ReadAllLines(filename);
				foreach (string ln in lines) {
					try {
						string line = ln.Trim();
						if (line == String.Empty || line.StartsWith("#"))
							continue;

						string[] fields = line.Split('\t');
						if (fields.Length < 5 || fields.Length > 7)
							continue;

						string group = fields[0];
						string element = fields[1];

						string[] parts = fields[2].Split('/');
						DicomVR[] vrs = new DicomVR[parts.Length];
						for (int i = 0; i < vrs.Length; i++) {
							vrs[i] = DicomVR.Lookup(parts[i]);
						}

						string vm = fields[3];
						string name = fields[4];

						bool retired = false;
						if (fields.Length >= 6) {
							if (fields[5] == Retired)
								retired = true;
						}
						
						string creator = String.Empty;
						if (fields.Length == 7) {
							if (!String.IsNullOrEmpty(fields[6]))
								creator = fields[6];
							creator.Trim('\'');
						}

						Entries.Add(new DcmDictionaryEntry(group, element, name, creator, vrs, vm, retired));
					}
					catch { }
				}
				Initialzied = true;
			}
		}

		/// <summary>
		/// Internal use
		/// </summary>
		/// <param name="filename"></param>
		public static void ImportDcmtkPrivateDictionary(string filename) {
			lock (Lock) {
				string[] lines = File.ReadAllLines(filename);
				foreach (string ln in lines) {
					try {
						string line = ln.Trim();
						if (line == String.Empty || line.StartsWith("#"))
							continue;

						string[] fields = line.Split('\t');

						string[] parts = fields[0].Trim('(', ')').Split(',');
						if (parts.Length != 3)
							continue;

						string group = parts[0];
						if (group.Contains("-o-"))
							group = group.Substring(0, 2) + "xx";

						string creator = parts[1].Trim('"');

						string element = parts[2];
						if (element.Length == 2)
							element = "xx" + element;

						DicomVR vr = DicomVR.Lookup(fields[1]);

						string name = Format.AddSpaces(fields[2]);

						string vm = fields[3];

						Entries.Add(new DcmDictionaryEntry(group, element, name, creator, new DicomVR[] { vr }, vm, false));
					}
					catch { }
				}
			}
		}
	}
